import React from "react";

const TechStack = () => (
  <section className="py-20">
    <div className="container mx-auto px-8">
      <h2 className="text-3xl mb-12 text-center text-text-primary">
        I'm currently looking to join a <span className="text-accent">cross-functional</span> team
      </h2>
      
      <div className="flex flex-wrap justify-center gap-8">
        {[
          'figma', 'react', 'node', 'js', 'css', 'ai',
          'xd', 'next', 'mongodb'
        ].map((tech) => (
          <div 
            key={tech}
            className="w-12 h-12 rounded-full bg-accent/10 p-2 transition-all hover:scale-110 hover:bg-accent/20"
          >
            <img
              src={`/icons/${tech}.svg`}
              alt={tech}
              className="w-full h-full object-contain"
            />
          </div>
        ))}
      </div>
    </div>
  </section>
);

export default TechStack;
